import "./App.css";
import Footer from "./customer/components/Footer/Footer";
import NavBar from "./customer/components/Navigation/NavBar";
import HomePage from "./customer/pages/HomePage/HomePage";

function App() {
  return (
    <div className="App">
      <Router>
        <NavBar />
        <HomePage />
        <Footer />
      </Router>
    </div>
  );
}

export default App;
